class Demo2{static get inputProperties(){return["--lines"]}static getRandomPoint(a,b){var c=Math.floor;return[c(Math.random()*(a+1)),c(Math.random()*(b+1))]}static getWidth(){return Math.floor(30*Math.random())+1}static getColor(a,b){return a+Math.floor(Math.random()*b+1)}static getTransparency(){return Math.floor(101*Math.random())/100}paint(a,{width:b,height:c},d){const e=d.get("--lines");for(let f=0;f<e;f+=1){const d=Demo2.getRandomPoint(b,c),e=Demo2.getRandomPoint(b,c);a.beginPath(),a.moveTo(...d),a.lineTo(...e),a.lineWidth=Demo2.getWidth(),a.lineCap="square",a.strokeStyle=`rgba(${Demo2.getColor(36,150)}, ${Demo2.getColor(108,150)}, ${Demo2.getColor(12,200)}, ${Demo2.getTransparency()})`,a.stroke()}}}registerPaint("demo2",Demo2);